        sx={{
          bgcolor: "#cfe8fc",
          width: 1,
          height: "100vh",
          boxShadow: 3,
          borderRadius: "10px",
        }}>
        <Grid container spacing={2}>
          <Grid item xs={6} sx={{border: 1}}>
            {propsData.name}
          </Grid>
          <Grid item xs={6} sx={{border: 1}}>
